import React from 'react';

function Video(props) {
    return (
        <div className={"flex justify-center w-full"}>
            <iframe width="560" height="315" src="https://www.youtube.com/embed/aatr_2MstrI" frameBorder="0"
                    allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                    allowFullScreen></iframe>
            <iframe className={'w-3/4'} src={"https://www.youtube.com/embed/aatr_2MstrI"} allow={"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"} allowFullScreen={true}></iframe>
        </div>
    );
}

export default Video;
